    "2016-07-27T22:58:06.033172",nt"name": "waterbird-census-summary-2003",nt"isopen":
    false,nt"url": null,nt"notes": "Intensive surveys of waterbird use of the
    Patuxent Research Refuge have been conducted weekly since 1997. Originally surveys
    covered 53 wetland units encompassing approximately 560 acres, plus segments of
    the Patuxent and Little Patuxent Rivers. The amount of habitat has varied considerably
    over the years because of artificial draw-downs and drought. Three units were lost
    on North Tract in the past year; Rogue Harbor (17 acres) and Powerline (10 acres)
    were lost when beaver darns were destroyed. Midway (10 acres) was lost when beaver
    left the unit and the dam was breached.",nt"license_title": "License Not Specified",nt"extras":
